insert  into `disease`(`Disease_id`,`Disease_Name`,`Image`,`Description`,`Type`) values 
(1,'Fungal infection','/static/disease/FUNGAL-INFECTION-1.webp','Fungal infections of the skin are also known as ‘mycoses’. They are common and generally mild. However, in very sick or otherwise immune suppressed people, fungi can sometimes cause severe disease. \r\n\r\n','Fungal infection'),
(2,'Allergy','/static/disease/Allergy.jpg','Allergy is an abnormal response of the body to a foreign body, known as an antigen. It involves the ','Allergic'),
(3,'Diabetes ','/static/disease/diabetes.jpg','Diabetes is a chronic (long-lasting) health condition that affects how your body turns food into energy. Your body breaks down most of the food you eat into sugar (glucose) and releases it into your bloodstream. When your blood sugar goes up, it signals your pancreas to release insulin. Insulin acts like a key to let the blood sugar into your body’s cells for use as energy.','Chronic'),
(4,'Gastroenteritis','/static/disease/gastroentirities.jfif','Gastroenteritis is an inflammation of the lining of the stomach and intestines. The main symptoms include vomiting and diarrhea. It is usually not serious in healthy people, but it can sometimes lead to dehydration or cause severe symptoms.\r\n\r\n','Bacterial infection'),
(5,'Bronchial Asthma','/static/disease/asthma.jpg','Bronchial asthma is a serious global health problem. 5% to 10% of persons of all ages suffer from this chronic airway disorder. This review article presents important considerations of diagnosis and treatment in view of the current national and international asthma guidelines.','Chronic'),
(6,'Migraine','/static/disease/migraine.jpg','A migraine is a headache that can cause severe throbbing pain or a pulsing sensation, usually on one side of the head. It is often accompanied by nausea, vomiting, and extreme sensitivity to light and sound.','Genetic'),
(7,'Malaria','/static/disease/malaria.jpg','Malaria is a disease caused by a parasite. The parasite is spread to humans through the bites of infected mosquitoes. People who have malaria usually feel very sick with a high fever and shaking chills.','Parasitic infection'),
(8,'Chicken pox','/static/disease/Chicken pox.jpg','Chickenpox is an infection caused by the varicella-zoster virus. It causes an itchy rash with small, fluid-filled blisters. Chickenpox is highly contagious to people who havenot had the disease or been vaccinated against it. Chickenpox consists of an itchy, red rash that breaks out on the face, scalp, chest, back and, to a lesser extent, arms and legs. The spots quickly fill with a clear fluid, rupture and then turn crusty.\r\n\r\n','Viral infection'),
(9,'Common Cold','/static/disease/Common cold.jpg','The common cold is a viral infection of your nose and throat (upper respiratory tract). It is usually harmless, although it might not feel that way. Many types of viruses can cause a common cold.\r\n\r\n','Viral infection'),
(10,'Heart attack','/static/disease/heart attack.png','A heart attack occurs when the flow of blood to the heart is severely reduced or blocked. The blockage is usually due to a build up of fat, cholesterol and other substances in the heart (coronary) arteries. The fatty, cholesterol-containing deposits are called plaques. The process of plaque build up is called atherosclerosis. A heart attack is also called a myocardial infarction.\r\n\r\n','Viral infection'),
(11,'Varicose veins','/static/disease/varicose.jpg','Varicose veins are twisted, enlarged veins. Any vein that is close to the skin surface (superficial) can become varicosed. Varicose veins most commonly affect the veins in the legs. That is because standing and walking increase the pressure in the veins of the lower body.\r\n\r\n','Viral infection'),
(12,'Acne','/static/disease/acne.jpg','Acne is a skin condition that occurs when your hair follicles become plugged with oil and dead skin cells. It causes whiteheads, blackheads or pimples. Acne is most common among teenagers, though it affects people of all ages. The pimples and bumps heal slowly, and when one begins to go away, others seem to crop up.','Bacterial infection'),
(13,'Typhoid','/static/disease/thyroid.jpg','Thyroid disease is a general term for a medical condition that keeps your thyroid from making the right amount of hormones. Your thyroid typically makes hormones that keep your body functioning normally. When the thyroid makes too much thyroid hormone, your body uses energy too quickly. This is called hyperthyroidism.','Viral infection'),
(14,'Peptic ulcer disease','/static/disease/peptic ulcer.jpg','Peptic ulcers are open sores that develop on the inside lining of your stomach and the upper portion of your small intestine. The most common symptom of a peptic ulcer is stomach pain.\r\n\r\nPeptic ulcers include:\r\n\r\nGastric ulcers that occur on the inside of the stomach.\r\nDuodenal ulcers that occur on the inside of the upper portion of your small intestine (duodenum).\r\n','Viral infection'),
(15,'Drug Reaction','/static/disease/drug reaction.jpg','A drug allergy is the reaction of the immune system to a medicine. Any medicine — nonprescription, prescription or herbal — can provoke a drug allergy. However, a drug allergy is more likely with certain medicines.\r\n\r\nThe most common symptoms of drug allergy are hives, rash or fever.','Bacterial infection'),
(16,'GERD-Gastroesophageal ref','/static/disease/gerd.jfif','A digestive disease in which stomach acid or bile irritates the food pipe lining.\r\nThis occurs when stomach acid or bile flows into the food pipe and irritates the lining. Acid reflux and heartburn more than twice a week may indicate GERD.\r\n','Chronic'),
(17,'Pneumonia','/static/disease/pneumonia.jpeg','Pneumonia is an infection that inflames the air sacs in one or both lungs. The air sacs may fill with fluid or pus (purulent material), causing cough with phlegm or pus, fever, chills, and difficulty breathing. A variety of organisms, including bacteria, viruses and fungi, can cause pneumonia.','Bacterial infection'),
(18,'Tuberculosis','/static/disease/Tuberculosis.jpg','Tuberculosis (TB) is a potentially serious infectious disease that mainly affects the lungs. The bacteria that cause tuberculosis are spread from person to person through tiny droplets released into the air via coughs and sneezes.\r\n\r\n','Bacterial infection'),
(19,'Jaundice','/static/disease/jaundice.jpg','Jaundice is a condition in which the skin, sclera (whites of the eyes) and mucous membranes turn yellow. This yellow color is caused by a high level of bilirubin, a yellow-orange bile pigment. Bile is fluid secreted by the liver. Bilirubin is formed from the breakdown of red blood cells.','Viral infection'),
(20,'Urinary tract infection','/static/disease/urinary tract infecton.png','A urinary tract infection (UTI) is an infection in any part of the urinary system. The urinary system includes the kidneys, ureters, bladder and urethra. Most infections involve the lower urinary tract — the bladder and the urethra.\r\n\r\n','Bacterial infection'),
(21,'Acquired cold uricaria','/static/disease/230121-142644.jpg','Cold urticaria  is a skin reaction to cold that appears within minutes after cold exposure. Affected skin develops itchy welts (hives).\r\nPeople with cold urticaria experience widely different symptoms. Some have minor reactions to the cold, while others have severe reactions. For some people with this condition, swimming in cold water could lead to very low blood pressure, fainting or shock.\r\nCold urticaria occurs most frequently in young adults. If you think you have this condition, consult you','Viral infection'),
(22,'Actinic keratosis','/static/disease/230121-143344.jpg','An actinic keratosis is a rough, scaly patch on the skin that develops from years of sun exposure. It is often found on the face, lips, ears, forearms, scalp, neck or back of the hands.','Bacterial infection'),
(23,'Alopecia','/static/disease/230121-143752.jpg','Alopecia areata, also known as spot baldness, is a condition in which hair is lost from some or all areas of the body. Often, it results in a few bald spots on the scalp, each about the size of a coin.','Genetic'),
(24,'Cutaneous horns','/static/disease/230121-144342.jpg','Cutaneous horn , is a projectile, conical, dense, hyperkeratotic nodule that resembles the horn of an animal. The horn is composed of compacted keratin. A number of skin lesions can be found at the base of this keratin mound. Cutaneous horns most frequently occur in sites that are exposed to actinic radiation or burns, and hence, are typically found on upper parts of the face.','Chronic'),
(25,'Dandruff','/static/disease/230122-182603.jpg','Dandruff is a common condition that causes the skin on the scalp to flake. It is not contagious or serious. But it can be embarrassing and difficult to treat.\r\nMild dandruff can be treated with a gentle daily shampoo. If that does not work, a medicated shampoo may help. Symptoms may return later.\r\nDandruff is a mild form of seborrheic dermatitis.\r\n\r\n','Fungal infection'),
(26,'Hidradenitis Suppurativa(','/static/disease/230122-182918.jpg','Hidradenitis suppurativa is a condition that causes small, painful lumps to form under the skin. The lumps usually develop in areas where your skin rubs together, such as the armpits, groin, buttocks and breasts. The lumps heal slowly, recur, and can lead to tunnels under the skin and scarring.\r\nHidradenitis suppurativa tends to start after puberty.','Genetic'),
(27,'Ichthyosis','/static/disease/230122-183137.jpg','Ichthyosis is a condition that causes widespread and persistent thick, dry, \"fish-scale\" skin.There are at least 20 different types of ichthyosis. Some types are inherited at birth and other types are acquired during adulthood.\r\nThere is no cure for ichthyosis, but a daily skincare routine usually keeps the symptoms mild and manageable.','Genetic'),
(28,'Leg ulcer','/static/disease/230122-183419.jpg','A leg ulcer is a long-lasting (chronic) sore that takes more than 2 weeks to heal. It usually develops on the inside of the leg, between the knee and the ankle.','Chronic'),
(29,'Melasma(Pregnancy Mask)','/static/disease/230122-183602.jpg','A condition in which brown patches appear on the face.\r\nMelasma can be due to hormonal changes during pregnancy or from sun exposure. Women are much more likely than men to develop this condition.\r\nThe brown or grey-brown patches of melasma appear most often on the cheeks, forehead, nose and chin.','Radiation'),
(30,'Nail psoriasis','/static/disease/230122-184139.jpg','Nail psoriasis is an autoimmune disease that causes discoloration, pitting and changes in the structure of your nails. It can make you feel self-conscious, though you can buff your nails and apply nail polish to improve their appearance. Nail psoriasis isn’t contagious, and treatments can help your symptoms improve.','Bacterial infection'),
(31,'Pemphigus','/static/disease/230122-184352.jpg','Pemphigus is a disease that causes blisters and sores on the skin or mucous membranes, such as in the mouth or on the genitals.\r\nPemphigus can occur at any age, but it is most often seen in people who are middle-aged or older. ','Bacterial infection'),
(32,'Psoriasis','/static/disease/230218-123412.jpg','Psoriasis is a skin disease that causes a rash with itchy, scaly patches, most commonly on the knees, elbows, trunk and scalp. Psoriasis is a common, long-term (chronic) disease with no cure. It can be painful, interfere with sleep and make it hard to concentrate.','Fungal infection'),
(33,'Rosacea','/static/disease/230218-123827.jpg','Rosacea is a common skin condition that causes blushing or flushing and visible blood vessels in your face. It may also produce small, pus-filled bumps. These signs and symptoms may flare up for weeks to months and then go away for a while.','Genetic'),
(34,'Scalp folliculitis','/static/disease/230218-124331.jpg','Folliculitis is a common skin condition that happens when hair follicles become inflamed. It is often caused by an infection with bacteria. At first it may look like small pimples around the tiny pockets from where each hair grows (hair follicles).\r\n\r\n','Bacterial infection'),
(35,'Shingles(Herpes Zoster)','/static/disease/230218-133424.jpg','Shingles is a viral infection that causes a painful rash. Shingles can occur anywhere on your body. It typically looks like a single stripe of blisters that wraps around the left side or the right side of your torso. Shingles is caused by the varicella-zoster virus — the same virus that causes chickenpox. ','Viral infection'),
(36,'Skin Cancer','/static/disease/230330-232325.jpg','Skin cancer — the abnormal growth of skin cells — most often develops on skin exposed to the sun. But this common form of cancer can also occur on areas of your skin not ordinarily exposed to sunlight. There are three major types of skin cancer — basal cell carcinoma, squamous cell carcinoma and melanoma. You can reduce your risk of skin cancer by limiting or avoiding exposure to ultraviolet (UV) radiation. ','Radiation'),
(37,'Skin tags','/static/disease/230330-233230.jpg','Skin tags are small, noncancerous growths that form when the skin rubs against itself. They typically don’t require treatment. But if their appearance bothers you, you can undergo a skin tag removal procedure. It’s important to receive care from a health professional and not try to treat them yourself.\r\n','Allergic'),
(38,'Vasculitis','/static/disease/230330-233519.jpg','Vasculitis involves inflammation of the blood vessels. The inflammation can cause the walls of the blood vessels to thicken, which reduces the width of the passageway through the vessel. If blood flow is restricted, it can result in organ and tissue damage. There are many types of vasculitis, and most of them are rare. ','Parasitic infection'),
(39,'Vitiligo','/static/disease/230330-233934.jpg','Vitiligo is a disease that causes loss of skin colour in patches. The discoloured areas usually get bigger with time. The condition can affect the skin on any part of the body. It can also affect hair and the inside of the mouth. Normally, the colour of hair and skin is determined by melanin. Vitiligo occurs when cells that produce melanin die or stop functioning. ','Bacterial infection');
